import React from "react";
import { Card } from "react-bootstrap";

const BudgetCard = ({ name, price }) => {
  return (
    <Card>
      <Card.Body>
        <Card.Title>
          <div>{name}</div>
          <div>{price}</div>
        </Card.Title>
      </Card.Body>
    </Card>
  );
};

export default BudgetCard;
